const Home = () => {
  return (
    <>
     <div className='main'>
     <div className='left'>
        <img src={money} alt='graphics' />
     </div>
     <div className="right">
        <img src={icon} alt='hwo'/>
        <h1>WELCOME TO SURPLUS!</h1>
        <h5>Manage your retirement finances with ease</h5>
        <button><Link to={"/dashboard"}>Get Started</Link></button>
     </div>
     </div>
    </>
  )
}

export default Home
